import React from 'react';

import './App.css';
import FirstPage from './login-page'
import IntroPage from './intro-page';

function App() {
  return (
    <BrowserRouter>
        <div>
            <Route exact path="/" component={IntroPage}  />
            <Route path="/login" component={FirstPage}/>
        </div>
    </BrowserRouter>

  );
}

export default App;
